import React, { useState } from "react"
import { login } from "../services/login_service"
import Layout from "../components/layout"

export type LoginInputs = {
  email: string
  password: string
}

function Page() {
  const initialValues: LoginInputs = { email: "rickety_cricket@example.com", password: "shhh!", };

  const [inputs, setInputs] = useState(initialValues);
  const [error, setError] = useState("");

  const handleSubmit = async (e: any) => {
    e.preventDefault();
    const res = await login(inputs);
    if (res) setError(res);
  };

  const handleInputChange = (e: React.ChangeEvent<any>) => {
    e.persist();
    setInputs({
      ...inputs,
      [e.target.name]: e.target.value,
    });
  };

  return (
      <Layout title="Авторизация">
        <section className="auth-wrap">
          <div className="container">
            <div className="auth-wrap__vn">
              <div className="auth-wrap__form">
                <h1>Sign in</h1>
                <p>Simplify your workflow in minutes.</p>
                <form className="mb-6" onSubmit={handleSubmit}>
                  <div className="form-group">
                    <label htmlFor="email">
                      Email Address
                    </label>
                    <input type="email" id="email" name="email" onChange={handleInputChange} value={inputs.email} placeholder="rickety_cricket@example.com"/>
                  </div>
                  <div className="form-group mb-5">
                    <label htmlFor="password">
                      Password
                    </label>
                    <input type="password" id="password" name="password" onChange={handleInputChange} value={inputs.password} placeholder="********"/>
                  </div>
                  <button className="btn btn-block btn-primary" type="submit">
                    Login
                  </button>
                </form>
                <p className="mb-0 font-size-sm text-center text-muted">
                  Don't have an account yet? <a href="signup-illustration.html">Sign up</a>.
                </p>
              </div>
              <div className="auth-wrap__bg">
                <img src="/login-bg.png" alt="login" />
              </div>
            </div>
          </div>
        </section>
      </Layout>
  )
}

export default Page;
